            else:
                return (None, k)
        return (result, k)
    re = []
    (i, j) = (0, 0)
    while i < n or j < m:
        if a[i] <= b[j]:
            x = a[i]
            i += 1
        else:
            x = b[j]
            j += 1
        if x == 0:
